window.bookSummaryJSON = "<p><b>Infinite power at your fingertipsâ€”but will it be enough?</b></p> <p>Following her victory against the aliens in Washington, Anya Nowicki has allied herself with the Department of Extraterrestrial Research and Defense: a newly formed organization headed by the shrewd Director MacDougal. Other hosts for the Archive, like Anya, have also joined the DERD, dedicating their time and efforts to honing their supernatural abilities and searching for whatever aliens remain on Earth.</p> <p>The hostile creatures known as gnosiphages have gone into hiding, but they have not remained idle. Hosts have been vanishing overnight, along with many civilians all across the globe. Something is still out there, stalking mankind, building its own power. It will take everything Anya has, and all her friends working together, to save the Earth from the apocalyptic crisis rushing towards it.</p>"; 
